window.bookSummaryJSON = "<p>\"The pairing of Reynolds's narration with Sullivan's multilayered storytelling is outstanding.\" — <i>AudioFile</i> Magazine</p> <p>A daughter vanishes. Two rogues are paid a fortune to find her. It isn't enough. </p> <p>When Gabriel Winter's daughter mysteriously disappears and is presumed dead, the wealthy whiskey baron seeks revenge. Having lived in Colnora during the infamous Year of Fear, he hires the one man he knows can deliver a bloody retribution — the notorious Duster. </p> <p>Ride with Royce and Hadrian as the cynical ex-assassin and idealistic ex-mercenary travel to a mysterious old-world city filled with nobles claiming descent from imperial aristocracy. Riyria's job appears easy: discover what happened to the missing duchess and, if she lives, bring her home...if not, punish those responsible. But nothing is simple in the crowded, narrow, mist-filled streets of Rochelle, where more than one ancient legend lurks. </p>"; 
